INSERT INTO `films` VALUES (1,'學會靶心人公式，三分鐘說18萬個故事—許榮哲故事課','https://www.youtube.com/watch?v=kb0whVogBkI&feature=emb_logo',0,'1','2020-12-03 09:00:00','2020-10-26 12:00:00','00:03:17',0,'三分鐘隨時隨地說故事。人際互動上，故事產生溝通力； 個人品牌上，故事打造影響力、說服力；商業運營上，故事產生行銷力； 故事可以進一步成為小說、劇本、電影的創作素材。',1,'<p><span noto=\"\" sans=\"\" style=\"color: rgb(96, 96, 96); font-family: \" tc=\"\">學會製作影片的完整程序和技術，包括器材選擇、器材操作、鏡頭語言、構圖方式、運鏡手法、燈光設計 、色調運用、後期剪輯、調色工序，並了解如何以製作影片為工作。</span></p>','2020-10-26 15:09:00','2020-10-26 15:18:12',NULL),(2,'三小時學會拆解社會現象與新聞議題！','https://www.youtube.com/watch?v=Dx5qFachd3A',0,'2','2020-11-04 09:00:00','2020-11-04 11:00:00','02:00:00',0,'對新聞事件與社會議題能快速判斷各方論點是否健全，看出誰是亂虎爛的假貨。當然，',1,'<p>對新聞事件與社會議題能快速判斷各方論點是否健全，看出誰是亂虎爛的假貨。當然，對新聞事件與社會議題能快速判斷各方論點是否健全，看出誰是亂虎爛的假貨。當然，</p>','2020-10-26 15:37:59','2020-10-26 15:37:59',NULL);
